import React from 'react';
import './style.css';
import logo from './img/logo.png';
import { Link } from 'react-router-dom';

const Navbar = ({ isLoggedIn }) => {
  const handleLogoClick = () => {
    window.location.href = 'http://localhost:3000/';
  };

  return (
    <div className="navbar">
      <a href="#rent">Rent</a>
      <a href="#shared-accommodation">Shared Accommodation</a>
      <a href="#agent-finder">Agent Finder</a>
      <div className="logo" onClick={handleLogoClick}>
        <img src={logo} alt="Logo" />
      </div>
      <a href="#manage-rentals">Manage Rentals</a>
      <a href="#favourite">Favourite</a>
      <Link to="components/Login.js">Sign In</Link> {/* Chuyển hướng đến "/login" khi nhấn vào "Sign In" */}
    </div>
  );
};

export default Navbar;
